#include <iostream>
using namespace std;

bool isPalindrome(int num) {
    int temp = num, rev = 0;

    // If the number is negative, it can't be a palindrome
    if (num < 0) return false;

    // Reverse the number
    while (temp != 0) {
        int rem = temp % 10;
        rev = rev * 10 + rem;
        temp = temp / 10;
    }

    // Check if the reversed number is equal to the original number
    return num == rev;
}

int main() {
    int num;
    cout << "Enter the number: ";
    cin >> num;

    if (isPalindrome(num)) {
        cout << "true" << endl;
    } else {
        cout << "false" << endl;
    }

    return 0;
}
```

